import React from 'react'
import { useState } from 'react';
import { Form,Button } from 'react-bootstrap';
function Add() {
    const [postEmployee,setPostEmplyee] = useState({
        name: '',
        email: '',
        department: ''
    });
    const handelChange = (e) =>{
        setPostEmplyee({
            ...postEmployee,
            [e.target.name]: e.target.value
        });
    }
    const handleSubmit = (e) =>{
        e.preventDefault();
        console.log(postEmployee);
    }
    const handleClose = () => {
        Navigate()
    }
  return (
    <div>
      <Form>
        <h2 className="text-center mb-4">Add Employee</h2>
        <Form.Group controlId="formName">
            <Form.Label>Name</Form.Label>
            <Form.Control type="text" placeholder="Enter name" value={postEmployee.name} onChange={handelChange} />
        </Form.Group>
        <Form.Group controlId="formEmail">
            <Form.Label>Email</Form.Label>
            <Form.Control type="email" placeholder="Enter email" value={postEmployee.email} onChange={handelChange}  />
        </Form.Group>
        <Form.Group controlId="formDepartment">
            <Form.Label>Department</Form.Label>
            <Form.Control type="text" placeholder="Enter department" value={postEmployee.department} onChange={handelChange} />
        </Form.Group>
        <Button variant="primary" type="submit" className="mt-3" onClick={handleSubmit}>
            Submit  
        </Button>
        <Button variant="secondary" className="ms-2" href="/employees" onClick={handleClose}>
            Cancel
        </Button>
      </Form>
    </div>
  )
}

export default Add;
